import { BrowserRouter as Router, Routes, Route } from "react-router-dom"
import home from "../components/home"

function App() {
  return (
    <Router>
      <div className="nav-container">
          <Routes>
            <Route path='/' exact element={<home/>}/>
          </Routes>
      </div>
    </Router>  
  );
}

export default App;
